--
-- Create procedure `Proc_GetServiceHobbyPaging`
--
CREATE DEFINER = 'roots'@'%'
PROCEDURE Proc_GetServiceHobbyPaging (IN $FilterName varchar(255), IN $PageIndex int, IN $PageSize int, OUT $TotalRecord int, OUT $TotalPage int)
BEGIN

  IF ISNULL($FilterName)
    OR LENGTH($FilterName) = 0 THEN
    SET $FilterName = '';
  END IF;

  SET $PageIndex = ($PageIndex - 1) * $PageSize;
  IF $PageSize > 0 THEN
    SELECT
      *
    FROM servicehobby s
    WHERE s.ServiceHobbyName LIKE CONCAT("%", $FilterName, "%")
    ORDER BY s.CreatedDate DESC
    LIMIT $PageIndex, $PageSize;

    SET $TotalRecord = (SELECT
        COUNT(*)
      FROM servicehobby s
      WHERE s.ServiceHobbyName LIKE CONCAT("%", $FilterName, "%"));

    SET @NumberRecordLastPage = $TotalRecord % $PageSize;

    IF @NumberRecordLastPage > 0
      && $TotalRecord > $PageSize THEN
      SET $TotalPage = FLOOR($TotalRecord / $PageSize) + 1;
    ELSEIF $TotalRecord < $PageSize THEN
      SET $TotalPage = 1;
    ELSE
      SET $TotalPage = $TotalRecord / $PageSize;
    END IF;
  END IF;
END
$$

