PROCEDURE Proc_GetMenuPaging (IN $Column varchar(500), IN $Where text, IN $Sort varchar(500), IN $PageSize int, IN $PageIndex int, OUT $TotalRecord int, OUT $TotalPage int)
BEGIN
  IF $PageIndex < 0 THEN
    SET $PageIndex = 1;
  END IF;

  IF $PageSize < 0 THEN
    SET $PageSize = 50;
  END IF;

  SET @Start = ($PageIndex - 1) * $PageSize;
  SET @Limit = $PageSize;
  SET @defaultSort = ' CreatedDate DESC ';
  SET @defaultWhere = '1 = 1';
  SET @defaultColumn = '*';

  IF ISNULL($Sort)
    OR LENGTH($Sort) = 0 THEN
    SET $Sort = @defaultSort;
  END IF;

  IF ISNULL($Column)
    OR LENGTH($Column) = 0 THEN
    SET $Column = @defaultColumn;
  END IF;

  IF ISNULL($Where)
    OR LENGTH($Where) = 0 THEN
    SET $Where = @defaultWhere;
  END IF;

  #lấy paging
  SET @sql = CONCAT('select ', $Column, ' from view_menu where ', $Where, ' order by ', $Sort, ' limit ?,?');

  PREPARE stmt FROM @sql;
  EXECUTE stmt USING @Start, @Limit;
  DEALLOCATE PREPARE stmt;

  #lấy total count 
  SET @count = 0;
  SET @sqlTotalCount = CONCAT('select count(*)', ' from view_menu where ', $Where, ' into @count');
  PREPARE stmtCount FROM @sqlTotalCount;
  EXECUTE stmtCount;
  DEALLOCATE PREPARE stmtCount;
  SET $TotalRecord = @count;

  SET @NumberRecordLastPage = $TotalRecord % $PageSize;

  IF @NumberRecordLastPage > 0 THEN
    SET $TotalPage = FLOOR($TotalRecord / $PageSize) + 1;
  ELSE
    SET $TotalPage = $TotalRecord / $PageSize;
  END IF;

END
$$

